                      <td>{check.isChecked && check.description}</td>
                      <td>{check.isChecked && check.column}</td> */}
                      <td>{check.dbtype}</td>
                      <td>{check.desc}</td>
                      <td>{check.description}</td>
                      <td>{check.column}</td>
                      <td>
                        {/* {check.isChecked && ( */}
                          <a href="url" data-toggle="modal" data-target="#flip">
                            f(x)
                          </a>
                        {/* )} */}
                      </td>

                      <Preview />
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>

