   // onTitleChange={handleTitleChange} onTitleOneChange={handleTitleOneChange} onTitleTwoChange={handleTitleTwoChange} onTitleThreeChange={handleTitleThreeChange} handleSubmit={onHandleSubmit} title={title.aggregate} titleOne={titleOne.window} titleTwo={titleTwo.partition} titleThree={titleThree.order} 
